import Container from "react-bootstrap/esm/Container";
import mySkills from "./MySkills";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import SkillItem from './SkillItem';
import Card from 'react-bootstrap/Card';
import { useState } from "react";



Object.keys(mySkills).map((key) => {
    Object.keys(mySkills[key]).map((innerKey) => {
        console.log(`${key}: ${innerKey} : ${mySkills[key][innerKey]}`)
    })
    console.log('------------------')
})



function Skills() {

    const [counter,updateCounter] = useState(0);


    return (

        <section className = 'myskills-section Poppins' id ='skills'>
            <Container fluid>

            <Col className ='myskills-header'>
                <h1>{`<%= My Skills %>`}</h1>
            </Col>

            
            {
                Object.keys(mySkills).map((key) => {
                
                return <div>
                            <br /> <br />
                            <div className = 'd-flex align-items-center skill-row mt-5 pt-5 mb-5 justify-content-center'>
                                <img src = {`../images/Skills/${key}.png`} alt = '' height={200} width={200}  />
                                <h1 className = 'skill-header' style ={{marginLeft:'25px'}}>{key}</h1> 
                            </div>
                            <Row>
                            {
                            Object.keys(mySkills[key]).map((innerKey) => {
                        return  <Col md={4} >
                                    <Card className='m-3 '  style={{ width: '12rem',backgroundColor:'transparent',borderColor:'transparent',boxShadow:'0 4px 3px 0 rgba(0, 0, 0, 0.2), 6px 6px 2px 6px rgba(0, 0, 0, 0.19)' }}>
                                    <Card.Img className='mt-5' variant="top" src={`../images/Skills/${innerKey}.png`} />
                                    <Card.Body ><br /><br />
                                        <Card.Title className='text-center bolder' style={{fontSize:'1.5rem'}}>{innerKey}</Card.Title><br /><br />
                                        <Card.Text className='text-center'>
                                            <div className = 'text-center outer-progress-bar'>
                                                <div className = 'text-center inner-progress-bar bold' style = {{width: `${mySkills[key][innerKey]}%`}}> 
                                                    <span>{mySkills[key][innerKey]}%</span>                  
                                                </div>
                                            </div>
                                        </Card.Text>
                                    </Card.Body>
                                    </Card>
                                </Col>
                    })}  
                            </Row>
                           
                          
                       

                    
                    </div>
                        
                    
                })
                
            }

            
                   
                
            
            
            <br /><br /><br /><br /><br /><br /> <br /><br /><br /><br /><br /><br />
            </Container>
        </section>


    )



}

export default Skills;
